//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13;

contract Campaign {
    address public creator;
    uint256 userId;
    string title;
    string description;
    uint256 cateId;
    uint256 public targetFunds;
    uint256 public deadline;

    mapping(address => uint256) public contributors;
    uint256 public minimumContribution;
    uint256 public raisedFunds;
    uint256 public noOfContributors;

    struct userFunds {
        uint256 _address;
        bytes32 _funds;
    }

    constructor(
        uint256 _userId,
        string memory _title,
        string memory _description,
        uint256 _cateId,
        uint256 _targetFunds,
        uint256 _deadline
    ) {
        userId = _userId;
        title = _title;
        description = _description;
        cateId = _cateId;
        targetFunds = _targetFunds;
        deadline = block.timestamp + _deadline;
        minimumContribution = 1 wei;
        creator = msg.sender;
    }

    function sendFunds() public payable {
        require(block.timestamp < deadline, "Deadline has passed.");

        require(
            msg.value >= minimumContribution,
            "Minimum Contribution is not met."
        );

        require(raisedFunds <= targetFunds, "Target goal has been acheived.");

        require(
            msg.value <= targetFunds,
            "Please check target amount and then pay."
        );

        require(
            msg.sender != creator,
            "Creator can not fund his own campaings."
        );

        if (contributors[msg.sender] == 0) {
            noOfContributors++;
        }

        contributors[msg.sender] += msg.value;

        raisedFunds += msg.value;

        if (raisedFunds > targetFunds) {
            address payable lastUser = payable(msg.sender);
            lastUser.transfer(raisedFunds - targetFunds);
            raisedFunds = targetFunds;
            contributors[msg.sender] = raisedFunds - targetFunds;
        }
    }

    function getRaisedFunds() public view returns (uint256) {
        return address(this).balance;
    }

    function getRemainingFunds() public view returns (uint256) {
        return targetFunds - address(this).balance;
    }

    function getTotalContributors() public view returns (uint256) {
        return noOfContributors;
    }

    function isContibutors(address _address) public view returns (bool) {
        if (contributors[_address] > 0) {
            return true;
        } else {
            return false;
        }
    }

    function getFundsOfContributor(address _address)
        public
        view
        returns (uint256)
    {
        return contributors[_address];
    }

    modifier onlyManger() {
        require(msg.sender == creator, "Only creater can withdraw funds.");
        _;
    }

    function withdrawFunds() public onlyManger {
        require(raisedFunds > 0, "Not enough balance to withdraw.");
        address payable owner = payable(creator);
        owner.transfer(raisedFunds);
        raisedFunds = raisedFunds - raisedFunds;
        noOfContributors = 0;
        targetFunds = 0;
    }
}
